Verenigde Staten
Komedie / Romantiek
109 minuten

een goeie film

met Justin Long, Drew Barrymore en Christina Applegate

Wanneer de vrijgevochten Erin (Drew Barrymore) en de kersverse vrijgezel Garrett (Justin Long) elkaar tegenkomen in New York, 
leidt dit tot een korte maar hartstochtelijke zomeraffaire. Geen van beiden is uit op een vaste relatie, maar wanneer Erin na de 
vakantie terugkeert naar haar woonplaats San Francisco, missen de twee elkaar eigenlijk meer dan verwacht.
